import React, {Component} from "react"
import Background from "../backgroundComponent/Background";
import Menu from "../menuComponent/Menu";
import ProjectContainer from "../projectsComponent/ProjectContainer";
import "../../assets/css/projectPage.css";
import StackGrid from "react-stack-grid";
import Project from "../projectsComponent/Project";
import twitter from "../../assets/img/twitter.png";
import fingertime from "../../assets/img/fingerTime.png";

var start = "0,0 70,0 60,40 50,60 40,100 0,100",
    end   = "0,0 25,0 20,20 20,80 15,100 0,100";

class ProjectPage extends Component{
    constructor(props) {
        super(props);
        this.props.history.push('/');
        this.props.history.push(this.props.match.url);
    }

    render() {
        return (
            <div className={"projectPage"}>
                <Background start={start} end={end} delay={0}/>
                <Menu header={"Projects"} thisSite={"/projects"}/>
                <StackGrid
                    className={"pintrestView"}
                    columnWidth={300}
                    duration={2000}
                    itemComponent={"Project"}
                >
                        <Project
                            link={"https://github.com/edsimon/TwitterStreams-sentimental-value-live-plotted-on-map"}
                            header={"Twitter streams"}
                            modalInfo={"So in this project I have been doing som explorations in the tweepy library. I have been trying to map the twitter feeds på location and got some pretty good results in my opinion."}
                            image={twitter}/>
                    <div>
                        <Project
                            link={"https://github.com/edsimon/HangTime"}
                            header={"Training app"}
                            modalInfo={"Made a app to simplify my training in the climbing gym. Makes it possible to create sessions and look back at some statistics."}
                            image={fingertime}/>
                    </div>
                    <div>
                        <Project
                            link={"https://github.com/edsimon/TwitterStreams-sentimental-value-live-plotted-on-map"}
                            header={"Twitter streams"}
                            modalInfo={" So in this project I have been doing som explorations in the tweepy library. I have been trying to map the twitter feeds på location and got some pretty good results in my opinion. So in this project I have been doing som explorations in the tweepy library. I have been trying to map the twitter feeds på location and got some pretty good results in my opinion. So in this project I have been doing som explorations in the tweepy library. I have been trying to map the twitter feeds på location and got some pretty good results in my opinion."}
                            image={twitter}/>
                    </div>
                    <div>
                        <Project
                            link={"https://github.com/edsimon/HangTime"}
                            header={"Training app"}
                            modalInfo={"Made a app to simplify my training in the climbing gym. Makes it possible to create sessions and look back at some statistics."}
                            image={fingertime}/>
                    </div>
                    <div>
                        <Project
                            link={"https://github.com/edsimon/TwitterStreams-sentimental-value-live-plotted-on-map"}
                            header={"Twitter streams"}
                            modalInfo={"So in this project I have been doing som explorations in the tweepy library. I have been trying to map the twitter feeds på location and got some pretty good results in my opinion."}
                            image={twitter}/>
                    </div>
                    <div>
                        <Project
                            link={"https://github.com/edsimon/HangTime"}
                            header={"Training app"}
                            modalInfo={"Made a app to simplify my training in the climbing gym. Makes it possible to create sessions and look back at some statistics."}
                            image={fingertime}/>
                    </div>
                </StackGrid>

            </div>
        );
    }
}

export default ProjectPage;

